    false,nt"url": null,nt"notes": "The data were acquired in March 2005 using
    the NASA Experimental Advanced Airborne Research Lidar (EAARL) platform in Sussex
    County, Delaware. Once acquired, the data were processed by USGS personnel into
    both 2-foot contours and digital elevation models. Multiple returns were recorded
    for each laser pulse. This is a bare earth data set. The points have approximately
    a 3 m ground spacing. Water points remain in the bare earth data set, they have
    not been classified as water.",nt"owner_org": "e811f0b4-451f-4896-9e8f-fc6802837819",nt"extras":
